    let loaderTyped = new Typed('#typed-loader', {
        strings: [
            `CONNECTING TO THE PARADIGM
            <br><br>
            QUANTUM NETWORKING ESTABLISHED
            <br><br>
            LINK STATUS OPTIMAL
            <br><br>
            LOADING...`
        ],
        typeSpeed: 20,
        cursorChar: '█'
    })
    let maxCount = 100;
    let currentLoading = 0;
    
    let raf;
    function countUp(){
        if(currentLoading >= 100){
            cancelAnimationFrame(raf);
            document.getElementById('loader-main').remove();
            const event = new Event('doneLoading');
            window.dispatchEvent(event);
            return;
        }
        raf = requestAnimationFrame(countUp);
        currentLoading += 0.2
        document.getElementById('count').innerHTML = Math.round(currentLoading);
        
    }
    countUp();

    

</script>

